  render() {
    return (
      <div className="home">
        <div>
        <img src="/images/ironhub-logo.svg" alt="ironHub"/>
        </div>

          <div className="search-input">
            <Form.Control size="md" type="text" placeholder="Search By Technology, Student's Name, or Campus Location... " />
          </div>
        <br />
      </div>
    )
  }
}

export default Home
